import React from 'react'
import { Link, useNavigate } from 'react-router-dom'

import { useSelector } from 'react-redux';
import { getLocal } from '../helpers/auth';
import jwt_decode from "jwt-decode"






function Navbar() {

    const { username } = jwt_decode(getLocal())
    const history = useNavigate()
    const { user, count } = useSelector((state) => state.auth);

    const logout = () => {
        localStorage.removeItem('authToken')
        history('/login')
    }

    return (
        <div>
            <nav class="navbar navbar-light bg-light justify-content-between">
                <p class="navbar-brand"><Link className='nav-items' to='/'>Home</Link></p>
                <form class="form-inline">
                    <i class="bi bi-person"></i>
                    <div class="dropdown">
                        <button class="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                            Dropdown button
                        </button>
                        <div class="dropdown-menu" aria-labelledby="dropdownMenuButton">
                            <a class="dropdown-item" href="#">Action</a>
                            <a class="dropdown-item" href="#">Another action</a>
                            <a onClick={logout}class="dropdown-item" href="#"> </a>
                        </div>
                    </div>
                    {username && <button class="btn btn-outline-danger my-2 my-sm-0" type="submit">LOGOUT</button>}

                </form>
            </nav>
        </div>
    )
}

export default Navbar
